--- START_SHAPE_TEST_LOS_PROBE
---Asynchronously starts a line-of-sight (raycast) world probe shape test.
--- 
--- cpp
--- enum TraceFlags
--- {
---   None = 0,
---   IntersectWorld = 1,
---   IntersectVehicles = 2,
---   IntersectPedsSimpleCollision = 4,
---   IntersectPeds = 8,
---   IntersectObjects = 16,
---   IntersectWater = 32,
---   Unknown = 128,
---   IntersectFoliage = 256,
---   IntersectEverything = 4294967295
--- }
--- 
--- 
--- NOTE: Raycasts that intersect with mission_entites (flag = 2) has limited range and will not register for far away entites. The range seems to be about 30 metres.
--- 
--- Use the handle with [GET_SHAPE_TEST_RESULT](#\_0x3D87450E15D98694) or [GET_SHAPE_TEST_RESULT_INCLUDING_MATERIAL](#\_0x65287525D951F6BE) until it returns 0 or 2.
---@param x1 number
---@param y1 number
---@param z1 number
---@param x2 number
---@param y2 number
---@param z2 number
---@param flags any
---@param entity number
---@param p8 any
---@return any
function StartShapeTestLosProbe(x1, y1, z1, x2, y2, z2, flags, entity, p8)
end

